// 江湖中传来了一道绝命密令，需找到乱石阵中失落已久的秘籍《排序真解》，以恢复江湖秩序。
// 汏清门门人为此踏上了一条艰难的寻宝之路。门中传艺之秘即分而治之，方能克敌制胜。

function quickSort(arr) {
  // 若藏书只有一本，或者空无一册，自然无需要整理，直接返回便是。
  if (arr.length <= 1) return arr;

  // 拣选一位武林英豪为旗号，将此批秘籍以其为核心分两边堆放。
  const pivot = arr[0];
  const left = [];
  const right = [];

  // 余下的书籍，依据轻巧与否，比旗号较轻的放于左边，反之则放右侧以成二营。
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      left.push(arr[i]);
      // 巧劲秘本皆聚此。
    } else {
      right.push(arr[i]);
      // 沉重绝学归一旁。
    }
  }

  // 最后，各自将左右堆中书籍重复此法整顺，并以旗号置于中间，完成此次使命。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
